import React from 'react'
import '../App.css';
import CARD from './CARD';
import {useState} from 'react'

function GETCARDS( {state} ) {

     

    return (
        <div className="cards">
            <CARD  state= {state } />
        </div>
    )


    
}
export default GETCARDS;
